import React from 'react'

const logout = () => {
    
    const handleSubmit= async(e) => {
        e.preventDefault()
        try {
            window.localStorage.removeItem("user");
        }
        catch(error) {
            console.log(error);
        }
    }
  return (
    <div>
    <form id='logout' onSubmit={handleSubmit}>
        <button type="submit"> 

        </button>
    </form>
    logout</div>
  )
}

export default logout;
